#include <stdio.h>#include <stdlib.h>#include<iostream>using namespace std;struct Node{	int data;	struct Node* next;	struct Node* prev;	};	struct Node *head;	struct Node* GetNewNode(int d){	Node *myNode = new Node();		myNode->data = d;	myNode->prev = NULL;	myNode->next = NULL;	return myNode;}	void insert_infront(int d){	struct Node* newNode = GetNewNode(d);	if(head == NULL){		head = newNode;		return;	}	head->prev = newNode;	newNode->next = head;	head = newNode;}void Print(){  struct Node* temp = head;  cout<<"List is: ";  while(temp != NULL){	cout<<"<=>"<<temp->data;	temp = temp->next;  }}	int main(){	head = NULL;	insert_infront(1);	insert_infront(2);	insert_infront(3);	insert_infront(4);	insert_infront(5);	insert_infront(6);	insert_infront(7);		Print();		return 0;}